@hyder I think that if you already thought about removing it, that's an even better approach! Users could always grab that without the need for this feature inside the module (and with this fewer options and code to manage on the module).

For example we are doing this:

```terraform
# OKE cluster creation
module "oke_ksa_dev" {
#...
}

# Obtain provisioned Kubeconfig.
data "oci_containerengine_cluster_kube_config" "kube_config" {
  cluster_id = module.oke_ksa_dev.cluster_id
}

# Store in kubeconfig in vault.
resource "vault_generic_secret" "kube_config" {
  path = "my/cluster/path/kubeconfig"
  data_json = jsonencode({
    "data" : data.oci_containerengine_cluster_kube_config.kube_config.content
  })
}
```

